message:
Estas são fotografias de soldados americanos abusando de prisioneiros iraquianos em Abu Ghraib que foram mostradas em uma reportagem da CBS em 2004. Eles deram origem a um escândalo internacional e posterior investigação. De acordo com vários prisioneiros, soldados americanos os estupraram, os montaram a cavalo e os forçaram a buscar comida nos banheiros da prisão. Em particular, os presos disseram: "Eles nos fizeram andar de quatro como cachorros e latir. E se você não latir, eles batem na sua cabeça sem piedade. sacos na minha cabeça", "um americano me estuprou, ele desenhou uma mulher nas minhas costas e me obrigou a ficar em pose de cachorro, segurando meu próprio escroto em minhas mãos. De 2004 a agosto de 2007, o tribunal militar ouviu 11 casos militares dos EUA, oito deles receberam várias penas de prisão.

